function SuggestPage(){
    

    return(
        <div className="suggestPage">
            <h1>Make a suggestion</h1>
            <form>
                <input placeholder="Your name (Optional)"></input> <br />
                <input type="email" placeholder="Email (Optional)"></input><br />
                <textarea placeholder="What would you like to see?"></textarea><br />
                <button>SEND</button>
            </form>
        </div>

        
    )
}

